import React from 'react';
import {Link} from 'react-router-dom';
import './contact.css';
import Map from './Map';

function ContactUs(props){
    return(
        <div className="contactus">
            <div className='contactus-container'>
                <div className='contactus-map'>
                    <Map/>
                </div>
                <div className='contactus-info'>
                    <div className='contactus-title'>Contact Us</div>
                    <div className='contactus-customer'>
                        <input type='text' placeholder='Name' className='contactus-name'/>
                        <input type='text' placeholder='Email' className='contactus-name'/>
                        <input type='text' placeholder='Subject' className='contactus-name'/>
                        <input type='text' placeholder='Message' className='contactus-name'/>
                    </div>
                    <button className='contactus-btn'>Send Message</button>
                </div>
            </div>
         
        </div>
    )
}
export default ContactUs;
